import { MEALS_DEAL} from "./action"

export const mealsdealreducer = (store, { type, payload }) => {
    switch (type) {
        case MEALS_DEAL:
            return { ...store, mealsdealdata: payload };
        
            case MEALS_DEAL:
                return { ...store, mealsdealdata : payload };
        
            default:
            return store;
    }
};
